import React, { useState, useEffect } from 'react';
import { Container, Card, Form, Button, Table } from 'react-bootstrap';
import axios from 'axios';

const Buy = () => {
  const [purchases, setPurchases] = useState([]);
  const [formData, setFormData] = useState({
    inventory_id: '',
    seller: {
      name: '',
      address: '',
      phone: '',
      email: '',
      id_card_number: '',
    },
    units: '',
  });

  useEffect(() => {
    fetchPurchases();
  }, []);

  const fetchPurchases = async () => {
    try {
      const response = await axios.get('/purchase');
      setPurchases(response.data);
    } catch (error) {
      console.error('Error fetching purchases:', error);
    }
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    if (name.startsWith('seller.')) {
      const sellerField = name.split('.')[1];
      setFormData({
        ...formData,
        seller: {
          ...formData.seller,
          [sellerField]: value,
        },
      });
    } else {
      setFormData({
        ...formData,
        [name]: value,
      });
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post('/purchase', formData);
      fetchPurchases();
    } catch (error) {
      console.error('Error completing purchase:', error);
    }
  };

  return (
    <Container>
      <Card className="p-4 mb-4">
        <Card.Title>Purchase Management</Card.Title>
        <Card.Body>
          <Form onSubmit={handleSubmit}>
            <Form.Group controlId="formInventoryId">
              <Form.Label>Inventory ID</Form.Label>
              <Form.Control
                type="text"
                placeholder="Enter inventory ID"
                name="inventory_id"
                value={formData.inventory_id}
                onChange={handleChange}
              />
            </Form.Group>

            <Form.Group controlId="formSellerName">
              <Form.Label>Seller Name</Form.Label>
              <Form.Control
                type="text"
                placeholder="Enter seller name"
                name="seller.name"
                value={formData.seller.name}
                onChange={handleChange}
              />
            </Form.Group>

            <Form.Group controlId="formSellerAddress">
              <Form.Label>Seller Address</Form.Label>
              <Form.Control
                type="text"
                placeholder="Enter seller address"
                name="seller.address"
                value={formData.seller.address}
                onChange={handleChange}
              />
            </Form.Group>

            <Form.Group controlId="formSellerPhone">
              <Form.Label>Seller Phone</Form.Label>
              <Form.Control
                type="text"
                placeholder="Enter seller phone"
                name="seller.phone"
                value={formData.seller.phone}
                onChange={handleChange}
              />
            </Form.Group>

            <Form.Group controlId="formSellerEmail">
              <Form.Label>Seller Email</Form.Label>
              <Form.Control
                type="email"
                placeholder="Enter seller email"
                name="seller.email"
                value={formData.seller.email}
                onChange={handleChange}
              />
            </Form.Group>

            <Form.Group controlId="formSellerIdCard">
              <Form.Label>Seller ID Card Number</Form.Label>
              <Form.Control
                type="text"
                placeholder="Enter seller ID card number"
                name="seller.id_card_number"
                value={formData.seller.id_card_number}
                onChange={handleChange}
              />
            </Form.Group>

            <Form.Group controlId="formUnits">
              <Form.Label>Units</Form.Label>
              <Form.Control
                type="text"
                placeholder="Enter number of units"
                name="units"
                value={formData.units}
                onChange={handleChange}
              />
            </Form.Group>

            <Button variant="primary" type="submit">
              Complete Purchase
            </Button>
          </Form>
        </Card.Body>
      </Card>

      <Card>
        <Card.Body>
          <Card.Title>Purchase History</Card.Title>
          <Table striped bordered hover>
            <thead>
              <tr>
                <th>Inventory ID</th>
                <th>Seller Name</th>
                <th>Units</th>
                <th>Date</th>
              </tr>
            </thead>
            <tbody>
              {purchases.map(purchase => (
                <tr key={purchase.id}>
                  <td>{purchase.inventory_id}</td>
                  <td>{purchase.seller.name}</td>
                  <td>{purchase.units}</td>
                  <td>{new Date(purchase.purchase_date).toLocaleString()}</td>
                </tr>
              ))}
            </tbody>
          </Table>
        </Card.Body>
      </Card>
    </Container>
  );
};

export default Buy;
